  \"active\",\n\t\t\"hash\": \"\",\n\t\t\"description\": \"The Fire Regime Groups
  (FRG) were intended to characterize the presumed historical fire regimes within
  landscapes based on interactions between vegetation dynamics, fire spread, fire
  effects, and spatial context. FRG definitions have been altered from previous applications
  to best approximate the definitions outlined in the Interagency Fire Regime Condition
  Class Guidebook. These definitions were refined to create discrete, mutually exclusive
  criteria appropriate for use with LANDFIRE's fire frequency and severity data products.
